        super();
        this.state = {
            nowPlaying: null
        }
    }

    playVideo = (args) => {
        this.setState({ nowPlaying: args })
    }

    playNextUp = (args) => {
        console.log(args)
    }

    playNext = (args) => {
        console.log(args)
    }

    playNextPrevious = (args) => {
        console.log(args)
    }
