                                ||
                            </li>
                            <li>
                                &lt;
                            </li>
                            <li>
                                &gt;
                            </li>
                        </ul>
                    </div>
                    <div className="List">
                        <ul>
                            {this.props.response.items.map(videos => <li key={Math.random() * Math.random()} onClick={() => this.playVideo(videos.id.videoId)}>{videos.snippet.title}</li>)}
                        </ul>
